jQuery.noConflict();(function($){const fullPageContainer=$('#fullpage');const motionContainer=$('#motion-content');const mobileW=640;let timeoutId;let isMobile=false;let fullPage;$(document).ready(function(){setupFrontPage();window.onresize=function(){window.clearTimeout(timeoutId);timeoutId=window.setTimeout(setupFrontPage,500);}});function isMobileView(){const windowW=$(window).width();if(windowW>=mobileW){isMobile=false;}else{isMobile=true;}}
function setupFrontPage(){isMobileView();if(typeof fullPage!=="undefined"){fullPage.destroy('all');motionContainer.html('');}
if(isMobile){initMobileView();}else{initFullPage();}}
function initMobileView(){fullPageContainer.addClass('is-mobile');fpAfterRender();mobileSectionThemeDetection();}
function mobileSectionThemeDetection(){const sections=$('#fullpage .section');const slideNav=$('#slide-nav');const themeTolerance=($(window).height()/100)*25;const slideNavTolerance=($(window).height()/100)*95;$.each(sections,function(key,value){const section=$(this);section.removeClass('viewed');if(section.is(':in-viewport')&&isMobile){toggleSectionTheme(section);}
$(window).scroll(function(){if(section.is(':in-viewport('+themeTolerance+')')&&isMobile){toggleSectionTheme(section);}
if(section.is(':in-viewport('+slideNavTolerance+')')&&isMobile){if(section.hasClass('first')){slideNav.fadeIn();}else{slideNav.fadeOut();}}});});}
function initFullPage(){if(!$('body').hasClass('home')){return;}
const fullPageAnchors=birdThemeLocalVars.fullpageAnchors;loadDesktopCtaPhone();fullPageContainer.removeClass('is-mobile');let fullPageConfig={anchors:fullPageAnchors,scrollOverflow:true,fixedElements:'.top-nav, .mobile-nav, .motion, #slide-nav',scrollingSpeed:600,css3:true,easingcss3:'cubic-bezier(0.470, 0.130, 0.015, 0.995)',afterLoad:fpAfterLoad,onLeave:fpOnLeave,afterRender:fpAfterRender,};fullPage=new fullpage('#fullpage',fullPageConfig);$('#slide-nav').on('click',function(){fullPage.moveSectionDown();});}
function loadDesktopCtaPhone(){const phoneImg=$('#cta-desktop-phone');const phoneImgSrc=$('#cta-desktop-phone').data('img-src');if(phoneImg.hasClass('loaded')){return;}
phoneImg.attr('src',phoneImgSrc);phoneImg.addClass('loaded');}
function fpAfterRender(){const sections=$('#fullpage .section');$.each(sections,function(key,value){const section=$(this);setSectionBackground(section);section.removeClass('viewed');});fullPageContainer.addClass('loaded');}
function fpAfterLoad(origin,destination,direction){const enteringSection=$(destination.item);toggleSectionTheme(enteringSection);}
function toggleSectionTheme(section){if(section.hasClass('dark')){enableDarkTheme();}else{enableLightTheme();}}
function fpOnLeave(origin,destination,direction){const leavingSection=$(this.item);const enteringSection=$(destination.item);const leavingContent=leavingSection.find('.content-wrapper');const enteringContent=enteringSection.find('.content-wrapper');leavingSection.addClass('viewed');enteringSection.addClass('viewed');motionContainer.html('');setMotionContent(leavingSection,leavingContent,'leaving '+direction);setMotionContent(enteringSection,enteringContent,'entering '+direction);if(enteringSection.hasClass('the-footer')){disableSliderNav('all');}else if(enteringSection.hasClass('app-cta')){disableSliderNav('desktop');}else{enableSliderNav();}
maybeStopVideo(leavingSection);maybeStartVideo(enteringSection);}
function setMotionContent(parentContainer,element,type){const content=element.clone();let contentTheme='';if(parentContainer.hasClass('dark')){contentTheme='dark';}
if(parentContainer.hasClass('app-cta')){contentTheme=contentTheme+' app-cta';}
content.addClass('motion').addClass(contentTheme);switch(type){case'leaving down':content.find('.content').addClass('fadeOutUp');break;case'entering down':content.find('.content').addClass('fadeInUp delay');break;case'leaving up':content.find('.content').addClass('fadeOutDown');break;case'entering up':content.find('.content').addClass('fadeInDown delay');break;}
motionContainer.append(content);}
function setSectionBackground(section){if(section.hasClass('bg-video')){setSectionVideo(section);}else if(section.hasClass('bg-image')){setSectionImage(section);}}
function setSectionImage(section){const imageURL=section.data('bg-img');section.css({backgroundImage:'url('+imageURL+')',});}
function setSectionVideo(section){const videoSrc=section.data('bg-video');let video='';video='<div class="vimeo-wrapper">'+'<iframe src="'+videoSrc+'" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>'+'</div>';if(!fullPageContainer.hasClass('loaded')){section.prepend(video);}
if(!isMobile&&section.hasClass('first')){maybeStartVideo(section);}
if(isMobile){startStopMobileVideo(section);}}
function startStopMobileVideo(section){if(!section.hasClass('bg-video')){return;}
const iframe=$(section).find('.vimeo-wrapper iframe');if(iframe.length<1){return;}
const player=new Vimeo.Player(iframe);$(window).scroll(function(){if(!isMobile){return;}
if(section.is(':in-viewport')){player.play();}else{player.pause().then(function(){player.setCurrentTime(0);});}});}
function maybeStopVideo(section){if(!section.hasClass('bg-video')){return;}
const iframe=$(section).find('.vimeo-wrapper iframe');if(iframe.length<1){return;}
const player=new Vimeo.Player(iframe);player.pause().then(function(){player.setCurrentTime(0);});}
function maybeStartVideo(section){if(!section.hasClass('bg-video')){return;}
const iframe=$(section).find('.vimeo-wrapper iframe');if(iframe.length<1){return;}
const player=new Vimeo.Player(iframe);player.play();}
function enableDarkTheme(){$('.top-nav').addClass('dark');$('.mobile-nav').addClass('dark');$('#slide-nav').addClass('dark');}
function enableLightTheme(){$('.top-nav').removeClass('dark');$('.mobile-nav').removeClass('dark');$('#slide-nav').removeClass('dark');}
function enableSliderNav(){const nav=$('#slide-nav');nav.show();}
function disableSliderNav(context){const nav=$('#slide-nav');const windowW=$(window).width();if((context==='desktop')&&(windowW<1280)){return;}else{nav.hide();}}})(jQuery);
